const seedTables = async () => {
  await createTables();

  for (const location of sampleLocations) {
    const insertLocationQuery = {
      text: "INSERT INTO locations (name, description, image_url) VALUES ($1, $2, $3)",
      values: [location.name, location.description, location.image_url],
    };

    try {
      await pool.query(insertLocationQuery);
      console.log(`✅ ${location.name} added successfully`);
    } catch (err) {
      console.error("⚠️ error inserting location", err);
    }
  }

  for (const event of sampleEvents) {
    const insertEventQuery = {
      text: "INSERT INTO events (location_id, title, description, event_date, image) VALUES ($1, $2, $3, $4, $5)",
      values: [
        event.location_id,
        event.title,
        event.description,
        event.event_date,
        event.image,
      ],
    };

    try {
      await pool.query(insertEventQuery);
      console.log(`✅ ${event.title} added successfully`);
    } catch (err) {
      console.error("⚠️ error inserting event", err);
    }
  }
};

seedTables();
